import React, {useState, useEffect} from "react";
import {Link, useNavigate} from 'react-router-dom';
import { useDispatch, useSelector } from "react-redux";
import { postCliente, getObrasSociales } from "../redux/actions";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, FormGroup, Label, Col, Input, Button, Container, 
          Dropdown, DropdownToggle, DropdownMenu, DropdownItem, Alert, Badge, CloseButton, Row} from 'reactstrap';

function validate(input){
  let errors = {};
  if(!input.nombre) {
    errors.nombre = "se requiere un nombre";
  } 
  if(!input.apellido) {
    errors.apellido = "se requiere un apellido"
  }
  if(!input.dni) {
    errors.dni = "se requiere un DNI";
  }
  return errors;
}






export default function ClientCreate(){
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const obrasSociales = useSelector((state) => state.obrasSociales);
  const [selectedObraSocial, setSelectedObraSocial] = useState("");
  const [errors, setErrors] = useState({});
  const [dropdownOpen, setDropdownOpen] = useState(false);
  const toggleDropdown = () => setDropdownOpen(!dropdownOpen);
  const [input, setInput] = useState({
    nombre: '',
    apellido: '',
    puntos: 0,
    dni: '',
    numeroDeAfiliado: '',
    direccion: '',
    telefono: '',
    obraSocial: []
  });

  function handleChange(e){
    setInput({
      ...input,
      [e.target.name] : e.target.value
    })
    setErrors(validate({
      ...input,
      [e.target.name] : e.target.value
    }));
    console.log(input);
  };

  function handleSelect(e){
    if(e.target.value){
      setInput({
        ...input,
        obraSocial: [...input.obraSocial, e.target.value]
      });
      setSelectedObraSocial("");
    }  
  };

  function handleDelete(el){
    setInput({
      ...input,
      obraSocial: input.obraSocial.filter(os => os !== el)
    })
  }

  function handleSubmit(e){
    e.preventDefault();
    console.log(input);
    dispatch(postCliente(input));
    alert('cliente creado con Ã©xito!');
    setInput({
      nombre: '',
      apellido: '',
      puntos: 0,
      dni: '',
      numeroDeAfiliado: '',
      direccion: '',
      telefono: '',
      obraSocial: []
    });
    navigate('/home');
  }

  useEffect(()=>{
    dispatch(getObrasSociales());
    
  }, [dispatch]);

  return(
    <Container>
      <br/>
      <h1>Crear Nuevo Cliente</h1>
      <Form onSubmit={(e) => handleSubmit(e)} onKeyDown={(e) => e.key === 'Enter' && e.preventDefault()}>
        <FormGroup row>
          <Label for='nombre' sm={2}><h5>Nombre*</h5></Label>
          <Col sm={8}>
          <Input id='nombre' type="text" value={input.nombre} name='nombre' onChange={(e) => handleChange(e)}/>
          {errors.nombre && (<Alert color="danger">{errors.nombre}</Alert>)}
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='apellido' sm={2}><h5>Apellido*</h5></Label>
          <Col sm={8}>
          <Input id='apellido' type="text" value={input.apellido} name='apellido' onChange={(e) => handleChange(e)}/>
          {errors.apellido && (<Alert color="danger">{errors.apellido}</Alert>)}
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='dni' sm={2}><h5>D.N.I*</h5></Label>
          <Col sm={8}>
          <Input id='dni' type="text" value={input.dni} name='dni' onChange={(e) => handleChange(e)}/>
          {errors.dni && (<Alert color="danger">{errors.dni}</Alert>)}
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='puntos' sm={2}><h5>Puntos</h5></Label>
          <Col sm={8}>
          <Input id='puntos' type="number" value={input.puntos} name='puntos' onChange={(e) => handleChange(e)}/>
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='numeroDeAfiliado' sm={2}><h5>Numero de Afiliado</h5></Label>
          <Col sm={8}>
          <Input id='numeroDeAfiliado' type="text" value={input.numeroDeAfiliado} name='numeroDeAfiliado' onChange={(e) => handleChange(e)}/>
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='direccion' sm={2}><h5>DirecciÃ³n</h5></Label>
          <Col sm={8}>
          <Input id='direcciÃ³n' type="text" value={input.direccion} name='direccion' onChange={(e) => handleChange(e)}/>
          </Col>
        </FormGroup>
        <FormGroup row>
          <Label for='telefono' sm={2}><h5>TelÃ©fono</h5></Label>
          <Col sm={8}>
          <Input id='telefono' type="text" value={input.telefono} name='telefono' onChange={(e) => handleChange(e)}/>
          </Col>
        </FormGroup>
        
        
        <FormGroup row>
          <Label for='obrasSociales' sm={2}><h5>Obras Sociales</h5></Label>
          <Col sm={2}>
          <Dropdown isOpen={dropdownOpen} toggle={toggleDropdown} className="d-inline-block">
            <DropdownToggle caret color="primary">elige una obra social</DropdownToggle>
            <DropdownMenu>
            {obrasSociales.map((os) =>(
              <DropdownItem key={os.nombre} value={os.nombre} onClick={(e) => handleSelect(e)}>
                {os.nombre.toUpperCase()}
              </DropdownItem> ))}
            </DropdownMenu>
          </Dropdown>
          </Col>
          </FormGroup>
          <FormGroup row>
            {input.obraSocial.map((el, index) => 
              <Col sm={3} key={el + index}>
                <h4>
                  <Badge  color="warning" pill>{el.toUpperCase()}
                    <CloseButton onClick={() => handleDelete(el)}/>
                  </Badge>
                </h4>
              </Col> )}
          </FormGroup>
          
        <br/>
        {Object.keys(errors).length?
        <Button color="secondary" type="submit" disabled>crear</Button>
        :
        <Button  color="success" type="submit">crear</Button>
        }    
      <Link to={'/home'}><Button className="ms-2" color="danger">cancelar</Button></Link>
      </Form>

      
    </Container>
  )
}
